        [StringNames.ScientistBlurbMed]: "Access vitals at anytime.\nComplete tasks to recharge your battery",
        [StringNames.ScientistBlurbLong]: "The Scientist can access a portable vitals panel anywhere to check on the status of the crew. However the portable vitals panel needs to be charged, so the Scientist will need to complete tasks in order to fill the battery.",
        [StringNames.EngineerBlurbMed]: "Can use the vents",
        [StringNames.EngineerBlurbLong]: "The Engineer is a Crewmate who can use vents to move around quicker, as well as catch venting Impostors in the act. You can't stay in there forever though, so be careful of who you vent around...",
        [StringNames.GuardianAngelBlurbMed]: "Cast protection shield around the remaining crew",
        [StringNames.GuardianAngelBlurbLong]: "The Guardian Angel is the ghost of the first dead Crewmate. They can temporarily shield and protect other living Crewmates. Time it properly and you'll be able to prevent Impostors from killing their victim. Lucky!",
        [StringNames.ShapeshifterBlurbMed]: "Disguise yourself by morphing into other Crewmates",
        [StringNames.ShapeshifterBlurbLong]: "The Shapeshifter can change their appearance and disguise themselves as other Crewmates. Do it well to frame other Crewmates and create confusion about who the real Impostor is. But watch out - the disguise doesn't last forever and leaves evidence behind.",
