        [StringNames.HowToPlayText1]: "Among Us es un juego de trabajo en equipo y traición.\n\nLos jugadores son tripulantes o impostores.",
        [StringNames.HowToPlayText2]: "Juega partidas de 4-15 jugadores en línea o por wifi local.",
        [StringNames.HowToPlayText41]: "Cuando organizas una partida, controlas el modo de juego.",
        [StringNames.HowToPlayText42]: "Primero, decides con quién quieres jugar.\n\nSi prefieres hacerlo con amigos en línea, elige Privada y comparte el código de la sala.\n\nSi quieres jugar con gente de todo el mundo, elige Pública.",
        [StringNames.HowToPlayText43]: "¿Quieres jugar con más tareas? ¿Caminar más rápido? ¿Más impostores? Puedes cambiar la configuración si organizas la partida, pero confirma los cambios con los otros jugadores.",
        [StringNames.HowToPlayText44]: "Si alguien es grosero o envía mensajes no deseados, los anfitriones pueden vetarlo durante un tiempo como advertencia o expulsarlo de la sala para siempre.",
        [StringNames.HowToPlayTextMap]: "Los jugadores tienen acceso a un mapa personal que les ayuda a recorrer la nave.",
        [StringNames.HowToPlayTextCrew1]: "Objetivo: llena la barra de tareas grupales y descubre al impostor.",
        [StringNames.HowToPlayTextCrew2]: "Completa tareas y llena la barra.",
        [StringNames.HowToPlayTextCrew3]: "Reacciona al sabotaje del impostor.",
        [StringNames.HowToPlayTextCrew4]: "Reúne a todos si aparece el impostor.",
        [StringNames.HowToPlayTextCrew5]: "Reporta las muertes.",
        [StringNames.HowToPlayTextCrew6]: "Busca actividad sospechosa en el mapa de gestión y la seguridad.",
        [StringNames.HowToPlayTextImp1]: "Objetivo: mata a la tripulación.",
        [StringNames.HowToPlayTextImp2]: "Mézclate con la tripulación.",
        [StringNames.HowToPlayTextImp3]: "Muévete por los ductos.",
        [StringNames.HowToPlayTextImp4]: "Finge que haces tareas.",
        [StringNames.HowToPlayTextImp5]: "Sabotea la nave y engaña a la tripulación.",
        [StringNames.HowToPlayTextImp6]: "Cierra puertas y atrapa víctimas.",
        [StringNames.HowToPlayTextImp7]: "Mata tripulantes entre recuperaciones.",
        [StringNames.HowToPlayText5]: "Cuando juegas en persona, no se permite hablar. La partida debe ser justa para la tripulación y el impostor.\n\nSi el impostor mata a un jugador, este no puede hablar hasta el final de la partida.\n\nLos fantasmas siguen completando las tareas asignadas para ayudar a la tripulación.",
        [StringNames.HowToPlayText6]: "Cuando alguien reporta una muerte o convoca a una reunión urgente, la tripulación se reúne para hablar de lo que sabe sobre el impostor.\n\nAllí pueden hablar de la supuesta identidad del impostor y de la información que tienen. Cuando juegas en persona, los fantasmas no pueden hablar porque saben quién es el impostor.\n\nLos impostores tratan de demostrar que son inocentes o acusan a otro tripulante.",
        [StringNames.HowToPlayText7]: "Después de la charla, se vota por la identidad del impostor.\n\nSe expulsa de la nave a la persona elegida. Piensa bien antes de votar.\n\nSi la tripulación decide que no hay información suficiente, se puede omitir la votación para evitar la expulsión de alguien inocente y reunir más información.",
        [StringNames.HowToPlayText81]: "Practica en modo libre",
        [StringNames.HowToPlayText82]: "Configura las tareas como tripulante o practica estrategias letales como impostor.",
