        [StringNames.OnlineHelp]: "¿Cómo funciona?\n\n● Cuando organizas una partida, obtienes un código junto al botón de inicio.\n● Compártelo con amigos para crear una sala privada.\n● O toca Privada para cambiar la sala a pública y usar Buscar partida.\n● La persona que organiza puede vetar o expulsar jugadores si el chat está disponible.\n● ¿Aún tienes problemas? Háblanos en el canal de Discord.",
