        [StringNames.AdPolicyTitle]: "Política de anuncios",
        [StringNames.AdPolicyText]: "¿Podemos usar tus datos personales para proporcionarte anuncios personalizados? Si haces clic en Sí, los socios publicitarios como Google AdMob y Unity Ads recabarán datos de forma automática y usarán identificadores de dispositivos y cookies para personalizar los anuncios. Si haces clic en no, puede que aún veas anuncios no personalizados. Para quitar todos los anuncios, compra la mejora sin publicidad [httpstore]aquí[] para que ni tus amigos ni tú vean publicidad cuando organizan una partida. Para conocer más sobre las prácticas de privacidad de los socios publicitarios, consulta la [https://innersloth.com/privacy.php]política de privacidad[]. Puedes cambiar la decisión en cualquier momento desde el menú de configuración en Datos.",
