        [StringNames.ScientistBlurbMed]: "Accede a los estados en cualquier momento.\nCompleta las tareas para recargar tu batería",
        [StringNames.ScientistBlurbLong]: "El científico puede acceder al panel portátil de los estados en cualquier lugar para ver el estado de la tripulación. Pero el panel portátil de los estados necesita recargarse, así que el científico debe completar tareas para recargar la batería.",
        [StringNames.EngineerBlurbMed]: "Puede usar los ductos",
        [StringNames.EngineerBlurbLong]: "El ingeniero es un tripulante que puede usar los ductos para moverse más rápido, así como atrapar a los impostores espías en el acto. Pero no te puedes quedar ahí mucho tiempo, así que ten cuidado cuando espíes...",
        [StringNames.GuardianAngelBlurbMed]: "Lanza un escudo que protege a los tripulantes que quedan",
        [StringNames.GuardianAngelBlurbLong]: "El ángel guardián es el fantasma del primer tripulante muerto. Puede proteger temporalmente a los tripulantes vivos. Protégelos a tiempo para que evites que los impostores asesinen a su víctima. ¡Suerte!",
        [StringNames.ShapeshifterBlurbMed]: "Disfrázate y transfórmate en otro tripulante",
        [StringNames.ShapeshifterBlurbLong]: "El cambiaformas puede cambiar su apariencia y disfrazarse como otros tripulantes. Hazlo bien para incriminar a otros tripulantes y crear confusión sobre quién es el impostor real. Pero ten cuidado, el disfraz no durará para siempre, y además deja evidencias.",
