        [StringNames.MeetingHasVoted]: "{0} votou. Restam {1}.",
        [StringNames.HowToPlayText1]: "Among Us é um jogo de trabalho em equipe e sabotagem.\n\nOs jogadores se dividem entre Tripulantes e Impostores.",
        [StringNames.HowToPlayText2]: "Jogue em grupos de 4 a 15 jogadores online ou pela rede Wi-Fi local!",
        [StringNames.HowToPlayText41]: "O anfitrião controla as regras do jogo.",
        [StringNames.HowToPlayText42]: "Primeiro, você deve determinar com quem quer jogar!\n\nSe quiser jogar com seus amigos online, crie uma partida \"privada\" e compartilhe o código da sala.\n\nSe quiser jogar com gente do mundo inteiro, crie uma partida \"pública\".",
        [StringNames.HowToPlayText43]: "Quer mais tarefas? Que tal andar mais rápido? Mais Impostores? Como anfitrião, você pode alterar essas configurações. Mas não deixe de comunicar as alterações aos outros jogadores.",
        [StringNames.HowToPlayText44]: "Se alguém for grosso e/ou enviar spam, o anfitrião pode expulsar o jogador temporariamente como advertência ou banir o jogador da sala.",
        [StringNames.HowToPlayTextMap]: "Os jogadores têm acesso a um mapa pessoal para se orientarem dentro da nave.",
        [StringNames.HowToPlayTextCrew1]: "Objetivo: encher a barra de tarefas do grupo ou descobrir o Impostor.",
        [StringNames.HowToPlayTextCrew2]: "Cumpra tarefas para encher a barra.",
        [StringNames.HowToPlayTextCrew3]: "Reaja às sabotagens do Impostor.",
        [StringNames.HowToPlayTextCrew4]: "Encontrou o Impostor? Reunião de Emergência!",
        [StringNames.HowToPlayTextCrew5]: "Notifique os corpos encontrados.",
        [StringNames.HowToPlayTextCrew6]: "Veja atividades suspeitas no Mapa de Admin e na Segurança.",
        [StringNames.HowToPlayTextImp1]: "Objetivo: eliminar a Tripulação.",
        [StringNames.HowToPlayTextImp2]: "Misture-se à Tripulação.",
        [StringNames.HowToPlayTextImp3]: "Desloque-se pelos dutos.",
        [StringNames.HowToPlayTextImp4]: "Finja que cumpre tarefas.",
        [StringNames.HowToPlayTextImp5]: "Sabote a nave e confunda a Tripulação.",
        [StringNames.HowToPlayTextImp6]: "Feche portas e prenda vítimas.",
        [StringNames.HowToPlayTextImp7]: "Objetivo: eliminar Tripulação entre esperas.",
        [StringNames.HowToPlayText5]: "Ao jogar com amigos no mesmo ambiente físico, não é permitido conversar (para manter o jogo justo entre a Tripulação e o Impostor).\n\nSe um jogador for morto pelo Impostor, ele não pode falar enquanto a partida não acabar.\n\nOs Fantasmas continuam a cumprir tarefas para levar uma possível vitória à Tripulação.",
        [StringNames.HowToPlayText6]: "Quando alguém notifica um corpo ou convoca uma reunião de emergência, a Tripulação se reúne para discutir o que sabe sobre o Impostor.\n\nOs jogadores podem então conversar abertamente sobre quem suspeitam que seja o Impostor e sobre suas informações. Ao jogar com amigos no mesmo ambiente físico, os Fantasmas não podem falar, pois já sabem quem é o Impostor.\n\nOs Impostores vão tentar provar sua inocência ou acusar outros Tripulantes.",
        [StringNames.HowToPlayText7]: "Após a discussão, vote em quem você acha que é o Impostor.\n\nO mais votado será ejetado da nave, então vote com cuidado!\n\nSe você não tiver informações o suficiente, ou se a Tripulação assim decidir, é possível pular a votação e evitar que um inocente seja ejetado, ganhando tempo para juntar mais informações.",
        [StringNames.HowToPlayText81]: "Pratique no modo Partida Livre!",
        [StringNames.HowToPlayText82]: "Defina suas próprias tarefas como Tripulante ou pratique suas estratégias malignas de Impostor!",
