        [StringNames.AdPolicyTitle]: "Política de anúncios",
        [StringNames.AdPolicyText]: "Podemos usar seus dados pessoais para peneirar anúncios para você? Se clicar em \"Sim\", nossos parceiros publicitários, como o Google AdMob e o Unity Ads, vão recolher dados e empregar identificadores de dispositivo e cookies para personalizar os seus anúncios automaticamente. Se clicar em \"Não\", você ainda verá os anúncios não personalizados. Para remover todos os anúncios, é só contratar o serviço Zero Anúncios [httpstore]aqui[], assim não vão mais aparecer anúncios para você e seus amigos quando você for o anfitrião! Para saber mais sobre as práticas de privacidade dos nossos parceiros publicitários, confira a nossa [https://innersloth.com/privacy.php]Política de Privacidade[]. É possível alterar essa decisão a qualquer momento, na seção \"Dados\" do menu de configurações.",
