        [StringNames.HowToPlayText41]: "Quando organizas uma partida, és tu quem define as regras.",
        [StringNames.HowToPlayText42]: "Primeiro, escolhe com quem queres jogar!\n\nSe quiseres jogar online com amigos, escolhe \"Privada\" e partilha o código da sala.\n\nSe quiseres jogar com pessoas do mundo inteiro, escolhe \"Pública\".",
        [StringNames.HowToPlayText43]: "Queres mais tarefas? Mais velocidade? Mais Impostores? Se organizares a partida, podes alterar essas definições. Não te esqueças de consultar os outros jogadores sobre as alterações que desejas fazer.",
        [StringNames.HowToPlayText44]: "Se alguém for rude e/ou fizer spam, o organizador pode expulsar temporariamente o jogador, como um aviso, ou bani-lo da sala online em questão.",
        [StringNames.HowToPlayTextMap]: "Os jogadores têm acesso a um mapa pessoal para orientá-los pela nave.",
        [StringNames.HowToPlayTextCrew1]: "Objetivo: enche a barra de tarefas do grupo ou descobre o Impostor.",
        [StringNames.HowToPlayTextCrew2]: "Conclui tarefas para encher o indicador.",
        [StringNames.HowToPlayTextCrew3]: "Reage à sabotagem do Impostor.",
        [StringNames.HowToPlayTextCrew4]: "Viste o Impostor? Reunião de emergência!",
        [StringNames.HowToPlayTextCrew5]: "Denuncia os corpos dos mortos.",
        [StringNames.HowToPlayTextCrew6]: "Procura atividades suspeitas no Mapa Admin e na Segurança.",
        [StringNames.HowToPlayTextImp1]: "Objetivo: elimina a Tripulação.",
        [StringNames.HowToPlayTextImp2]: "Mistura-te na Tripulação.",
        [StringNames.HowToPlayTextImp3]: "Esgueira-te pela ventilação.",
        [StringNames.HowToPlayTextImp4]: "Finge que fazes tarefas.",
        [StringNames.HowToPlayTextImp5]: "Sabota a nave e deixa a tripulação confusa.",
        [StringNames.HowToPlayTextImp6]: "Fecha portas e encurrala vítimas.",
        [StringNames.HowToPlayTextImp7]: "Acaba com a tripulação entre reativações.",
        [StringNames.HowToPlayText5]: "Para manter o jogo justo entre a Tripulação e o Impostor, não é permitido falar durante uma partida.\n\nOs jogadores mortos pelo Impostor, não podem falar até ao final da partida.\n\nOs fantasmas podem continuar a concluir tarefas, de modo a ajudar os Tripulantes a vencer.",
        [StringNames.HowToPlayText6]: "Quando alguém denuncia o corpo de um morto ou convoca uma reunião de emergência, a Tripulação junta-se para discutir informações sobre o Impostor.\n\nÉ lá que os jogadores discutem livremente quem pensam ser o Impostor e partilham as suas informações. Os fantasmas não podem falar durante as partidas, pois já sabem quem é o Impostor.\n\nOs Impostores tentarão provar a sua inocência ou acusar outro tripulante.",
        [StringNames.HowToPlayText7]: "Após a discussão, vota em quem pensas ser o Impostor.\n\nQuem tiver a maioria dos votos será ejetado da nave, por isso vota com cautela!\n\nSe não tiveres informações suficientes, e caso a Tripulação o decida, podes ignorar a votação e evitar que alguém inocente seja ejetado, passando assim a reunir mais informações.",
        [StringNames.HowToPlayText81]: "Pratica no modo livre!",
        [StringNames.HowToPlayText82]: "Conclui as tarefas como tripulante ou pratica as estratégias de assassino como Impostor!",
