        [StringNames.LocalHelp]: "Probz de ligação?\n\n● Verifica se estão todos ligados à mesma rede Wi-Fi.\n● Verifica se todos têm a mesma versão (canto superior esquerdo).\n● Verifica se o teu sinal Wi-Fi é forte.\n● Às vezes o melhor é deixar outro jogador organizar a partida.\n● Às vezes o melhor é reiniciar o jogo...\n● Às vezes o melhor é reiniciar o telemóvel...\n● Continuas com problemas? Fala connosco no Discord!",
        [StringNames.OnlineHelp]: "Como é que isto funciona?\n\n● Os organizadores têm um código perto do botão Iniciar.\n● Partilha o código com os teus amigos para criar uma sala privada.\n● Ou toca em \"Privada\" para tornar a sala pública \ne exibi-la na opção \"Procurar partida.\".\n● Os organizadores podem banir ou expulsar jogadores sempre que o chat estiver disponível.\n● Continuas com problemas? Fala connosco no Discord!",
