        [StringNames.EmergencyRequested]: "PEDIDO DE REUNIÃO DE EMERGÊNCIA\nA AGUARDAR ORGANIZAÇÃO.",
        [StringNames.AdPolicyTitle]: "Política de Publicidade",
        [StringNames.AdPolicyText]: "Podemos usar os teus dados para gerar anúncios personalizados? Se clicares sim, o Google AdMob irá recolher dados, cookies e IDs de dispositivos para gerar anúncios personalizados. Se clicares não, continuarás a ver anúncios não personalizados. Para remover os anúncios compra a versão sem anúncios [httpstore]aqui[]. Se comprares esta versão, os teus amigos também não terão anúncios quando organizas partidas! Para mais informações sobre as práticas de privacidade dos nossos parceiros de publicidade, acede à nossa [https://innersloth.com/privacy.php]Política de Privacidade[]. Podes alterar a tua decisão quando quiseres, no menu de definições abaixo de ''Dados''.",
