        [StringNames.MeetingHasVoted]: "{0} 님이 투표했습니다. {1}명 남았습니다.",
        [StringNames.HowToPlayText1]: "Among Us는 팀워크와 배신의 게임입니다.\n\n플레이어는 크루원 또는 임포스터가 됩니다.",
        [StringNames.HowToPlayText2]: "온라인 또는 로컬 WiFi로 4~15명이 플레이할 수 있습니다!",
        [StringNames.HowToPlayText41]: "게임을 주최하면 게임 플레이 전반을 제어할 수 있습니다.",
        [StringNames.HowToPlayText42]: "먼저 누구와 함께 플레이할지 정하세요!\n\n친구와 온라인으로 플레이하고 싶다면 \"비공개\"로 설정한 후 방 코드를 공유하면 됩니다.\n\n전 세계 곳곳의 플레이어와 플레이하고 싶다면 \"공개\"로 설정하세요.",
        [StringNames.HowToPlayText43]: "임무의 수를 더 늘리고 싶으신가요? 이동 속도를 더 빠르게 하는 건 어때요? 임포스터를 늘리는 건요? 주최자는 이러한 설정을 변경할 수 있습니다. 동료 플레이어에게 변경 사항을 꼭 알리세요.",
        [StringNames.HowToPlayText44]: "특정 누군가가 무례하게 굴거나 스패밍하는 경우, 주최자는 경고의 의미로 해당 플레이어를 일시적으로 추방하거나 특정 온라인 방에서 차단할 수 있습니다.",
        [StringNames.HowToPlayTextMap]: "플레이어는 함선을 돌아다니는 데 도움이 될 개인 맵을 확인할 수 있습니다.",
        [StringNames.HowToPlayTextCrew1]: "목표: 그룹 임무 게이지를 모두 채우거나 임포스터를 발견하세요.",
        [StringNames.HowToPlayTextCrew2]: "임무를 완료해 게이지를 채우세요.",
        [StringNames.HowToPlayTextCrew3]: "임포스터의 방해 공작에 대응하세요.",
        [StringNames.HowToPlayTextCrew4]: "임포스터를 찾았다면 긴급회의를 소집하세요.",
        [StringNames.HowToPlayTextCrew5]: "시체를 발견하면 신고하세요.",
        [StringNames.HowToPlayTextCrew6]: "관리실 맵과 보안실을 확인해 수상한 활동이 있는지 감시하세요.",
        [StringNames.HowToPlayTextImp1]: "목표: 크루원을 처치하세요.",
        [StringNames.HowToPlayTextImp2]: "크루원 사이에 자연스럽게 섞이세요.",
        [StringNames.HowToPlayTextImp3]: "환풍구를 통해 살금살금 이동하세요.",
        [StringNames.HowToPlayTextImp4]: "임무를 수행하는 척하세요.",
        [StringNames.HowToPlayTextImp5]: "함선에 방해 공작을 일으켜 크루원 사이에 혼란을 일으키세요.",
        [StringNames.HowToPlayTextImp6]: "문을 닫아 피해자를 가두세요.",
        [StringNames.HowToPlayTextImp7]: "쿨다운 사이에 크루원을 처치하세요.",
        [StringNames.HowToPlayText5]: "크루원과 임포스터 사이 공정한 게임을 위해 플레이 중에는 대화가 허용되지 않습니다.\n\n임포스터에게 처치된 플레이어는 게임이 끝날 때까지 말을 할 수 없습니다.\n\n유령은 크루원의 승리를 돕기 위해 할당된 임무를 계속 수행할 수 있습니다.",
        [StringNames.HowToPlayText6]: "누군가 시체를 발견했다고 신고하거나 긴급회의를 소집한 경우, 크루원이 모여서 임포스터가 누구인지에 대해 논의할 수 있습니다.\n\n이때 플레이어는 임포스터가 누구라고 생각하는지, 자신이 어떤 정보를 갖고 있는지 자유롭게 이야기할 수 있습니다. 유령은 임포스터가 누구인지 이미 알고 있으므로 말할 수 없습니다.\n\n임포스터는 자신이 무죄임을 다른 사람이 믿게 하도록 속이거나, 다른 크루원에게 혐의를 씌울 수 있습니다.",
        [StringNames.HowToPlayText7]: "회의가 끝나면 임포스터라고 생각한 사람에게 투표하세요.\n\n가장 많은 표를 받은 플레이어는 함선에서 방출되므로, 현명하게 선택해야 합니다!\n\n크루원으로서 정보가 부족한 경우, 무고한 플레이어를 방출하지 않고 더 많은 정보를 수집할 수 있도록 투표를 건너뛸 수 있습니다.",
        [StringNames.HowToPlayText81]: "연습 모드에서 연습해보세요!",
        [StringNames.HowToPlayText82]: "크루원이 되어 직접 임무를 설정하거나, 임포스터로서 처치 전략을 연습하세요!",
