        [StringNames.LocalHelp]: "연결 문제가 있으신가요?\n\n● 모두가 같은 Wi-Fi 이름에 연결되어 있는지 확인하세요.\n● 모두가 같은 버전인지 확인하세요(왼쪽 상단에서 확인 가능).\n● Wi-Fi 신호가 강한지 확인하세요.\n● 다른 사람이 주최하면 문제가 해결될 수도 있습니다.\n● 앱을 재시작하면 도움이 될 때도 있죠...\n● 휴대폰을 재시작해서 해결되는 경우도 있고요...\n● 여전히 문제가 발생하나요? Discord를 통해 알려주세요!",
        [StringNames.OnlineHelp]: "어떤 식으로 이루어지나요?\n\n● 게임을 주최하면 시작 버튼 옆에 게임 코드가 표시됩니다.\n● 친구에게 게임 코드를 공유해 비공개 방을 만드세요.\n● \"비공개\"를 탭하면 다른 사람이 \"게임 찾기\"로 찾을 수 있는 공개 방을 만들 수 있습니다.\n● 주최자는 채팅이 가능한 곳에서 플레이어를 차단하거나 추방할 수 있습니다.\n● 여전히 문제가 발생하나요? Discord를 통해 알려주세요",
        [StringNames.EmergencyCount]: "크루원 {0}이(가)\n\n\n\n긴급회의를 소집할 수 있습니다.",
        [StringNames.EmergencyNotReady]: "크루원은 다음 긴급회의를 소집하기까지\n\n\n\n기다려야 합니다.",
        [StringNames.EmergencyDuringCrisis]: "위기 상황에서는\n긴급회의를 소집할 수 없습니다.",
        [StringNames.EmergencyRequested]: "긴급회의 요청됨\n주최자를 기다리는 중",
        [StringNames.AdPolicyTitle]: "광고 정책",
        [StringNames.AdPolicyText]: "Among Us는 앱을 무료로 제공하기 위해 매치가 끝날 때마다 AdMob 광고를 사용합니다.\n기본적으로 AdMob은 맞춤형 광고를 위해 데이터를 수집합니다. 또한 AdMob은 맞춤형 광고가 아니더라도\n계속해서 쿠키, 기기 ID, 대략적인 위치 정보를 사용합니다.\n이러한 부분은 비활성활 수 없으므로, 대신 광고 없는 업그레이드를 구매하시기 바랍니다(2 USD).\n\n\n광고 없음 업그레이드를 구매한 플레이어가 게임을 주최하면\n친구들도 광고 없이 게임을 즐길 수 있습니다.! 이전에 업그레이드를 구매했다면 스토어를 열고\n구매 내역을 복원하시기 바랍니다.",
        [StringNames.Accept]: "허용",
