        [StringNames.ScientistBlurbLong]: "과학자는 어디서든 휴대용 바이탈 체크 패널에 액세스해서 크루원의 상태를 확인할 수 있습니다. 하지만 휴대용 바이탈 체크 패널에는 충전이 필요하기 때문에 과학자는 배터리를 충전하기 위해 임무를 완료해야 합니다.",
