        [StringNames.HowToPlayText1]: "Among Us — игра о командной работе и предательстве,\nгде игроки получают роль члена экипажа или предателя.",
        [StringNames.HowToPlayText2]: "Можно играть онлайн или по локальной беспроводной сети в команде от 4 до 15 человек!",
        [StringNames.HowToPlayText41]: "При создании игры можно установить собственные правила.",
        [StringNames.HowToPlayText42]: "Сначала выберите, с кем хотите сыграть!\n\nЕсли хотите играть с друзьями, создайте частную комнату и поделитесь с ними кодом.\n\nЧтобы сыграть со случайными игроками, сделайте комнату общей.",
        [StringNames.HowToPlayText43]: "Вам не хватает заданий? Или хочется бегать побыстрее? А может быть, нужно больше предателей? Создавая комнату, владелец может настроить игру по своему вкусу. Только не забудьте обсудить это с остальными!",
        [StringNames.HowToPlayText44]: "Владелец может выгнать игроков за грубое поведение или спам в чате либо полностью их заблокировать для своей онлайн-комнаты.",
