        [StringNames.HowToPlayTextCrew6]: "Комнаты админа и охраны помогут засечь подозрительные действия.",
        [StringNames.HowToPlayTextImp1]: "Ваша цель: убить всех членов экипажа.",
        [StringNames.HowToPlayTextImp2]: "Смешивайтесь с толпой.",
        [StringNames.HowToPlayTextImp3]: "Пробирайтесь по вентиляции.",
        [StringNames.HowToPlayTextImp4]: "Притворяйтесь, что выполняете задания.",
        [StringNames.HowToPlayTextImp5]: "Занимайтесь саботажем и запутывайте других.",
        [StringNames.HowToPlayTextImp6]: "Блокируйте двери и готовьте засады.",
        [StringNames.HowToPlayTextImp7]: "Убивайте по окончании перезарядки.",
        [StringNames.HowToPlayText5]: "Играете вместе? Никаких разговоров! Игра должна быть честной.\n\nИгроки, убитые предателем, молчат до конца игры.\n\nПризраки по-прежнему могут выполнять задания, чтобы помочь команде победить.",
        [StringNames.HowToPlayText6]: "Если кто-то сообщил о трупе или созвал срочное собрание, команда пытается вычислить предателя.\n\nТеперь игроки могут открыто предполагать, кто предатель, и делиться наблюдениями. Если вы играете вместе, призраки должны молчать, поскольку им точно известно, кто предатель.\n\nПредатели попытаются доказать свою невиновность или перевести подозрения на другого игрока.",
        [StringNames.HowToPlayText7]: "После обсуждения проголосуйте за игрока, которого вы считаете предателем.\n\nИгрок, набравший большинство голосов, будет выброшен, так что хорошо обдумайте свое решение!\n\nЕсли имеющихся у вас сведений недостаточно, можно пропустить голосование, чтобы не выбросить невиновного и собрать больше информации.",
        [StringNames.HowToPlayText81]: "Практикуйтесь в режиме песочницы!",
        [StringNames.HowToPlayText82]: "Подберите себе задания, сыграв за члена экипажа, или отточите навыки убийства в роли предателя.",
