        [StringNames.ScientistBlurbLong]: "У ученого всегда есть доступ к переносной панели проверки пульса, позволяющий оценить состояние членов экипажа. Но ей необходима постоянная подзарядка, поэтому ученому нужно будет выполнять задания, чтобы заряжать батарею.",
        [StringNames.EngineerBlurbMed]: "Можно использовать вентиляцию",
        [StringNames.EngineerBlurbLong]: "Инженер — это член экипажа, который может использовать вентиляцию, чтобы быстрее передвигаться и ловить предателей прямо на месте преступления. Однако оставаться там вечно нельзя, так что следите за теми, кто находится рядом с вами...",
        [StringNames.GuardianAngelBlurbMed]: "Окружите оставшихся членов экипажа щитом",
        [StringNames.GuardianAngelBlurbLong]: "Ангел-хранитель — это призрак первого умершего члена экипажа. Он может временно защищать других живых членов экипажа. Выберите верный момент для использования щита, и тогда вы сможете помешать предателям убить свою жертву. Счастливчики!",
        [StringNames.ShapeshifterBlurbMed]: "Не дайте себя раскрыть, превращаясь в других членов экипажа",
        [StringNames.ShapeshifterBlurbLong]: "Оборотень может изменить свой внешний вид, маскируясь под других членов экипажа. Используйте эту способность с умом, чтобы подставлять других игроков и вносить сумятицу в поиски предателя. Но будьте осторожны: через некоторое время маскировка спадет и оставит улики, указывающие на ее использование.",
