        [StringNames.HowToPlayTextImp5]: "Isabotahe ang barko ug liboga ang Crew.",
        [StringNames.HowToPlayTextImp6]: "Isirado ang pultahan ug ipriso ang biktima.",
        [StringNames.HowToPlayTextImp7]: "Patya ang Crew sa panahon sa cooldown.",
        [StringNames.HowToPlayText5]: "Samtang personal nga nagdula, wala gitugutan ang pag-istoryahay aron mapabiling patas ang dula taliwala sa Crew ug sa Impostor.\n\nKung mapatay sa Impostor ang usa ka player, dili sila mahimong mag-istoryahay hangtud nga matapos ang dula.\n\nBuhaton gihapon sa mga kalag ang ilang mga nakatakdang task aron posibleng modaog ang Mga Crewmate.",
        [StringNames.HowToPlayText6]: "Kung adunay mag-report og patay nga lawas o motawag og emergency meeting, magtapok ang Crew aron hisgutan ang ilang nahibaluan mahitungod sa Impostor.\n\nMahimo na karong mag-istoryahay ang mga player mahitungod sa kung kinsa ang Impostor ug kung unsang impormasyon ang aduna sila. Kung personal nga magdula, dili mahimong moistorya ang Mga Kalag tungod kay nakahibalo na sila kung kinsa ang Impostor.\n\nMagsulay ang Mga Impostor sa pagpamatuod sa ilang pagkainosente o mag-akusa og laing miyembro sa crew.",
        [StringNames.HowToPlayText7]: "Pagkahuman sa pakighisgot, muboto ka kung kinsa ang Impostor.\n\nI-eject sa barko ang makakuha sa pinakadaghang boto, mao nga taronga ang pagboto!\n\nKung wala kay igong impormasyon ug nagdesisyon ka isip Crew, mahimo nimong laktawan ang pagboto aron malikayan ang pag-eject og inosenteng tawo ug mangita og dugang impormasyon.",
        [StringNames.HowToPlayText81]: "Pagpraktis sa Freeplay mode!",
        [StringNames.HowToPlayText82]: "Pagtakda og imong mga kaugalingong task isip miyembro sa Crew o praktisa ang imong mga istratehiya sa pagpatay isip Impostor!",
