        [StringNames.AdPolicyTitle]: "Palisiya sa Advertisement",
        [StringNames.AdPolicyText]: "Mogamit ang Among Us og mga ad sa AdMob pagkahuman sa kada sangka aron himuong libre kini nga app. Isip\ndefault, mangolekta ang AdMob og data para sa mga gitukma nga ad. Gamiton gihapon sa AdMob ang cookies, \nmga id sa device, ug coarse geo data bisan pa para sa mga dili naka-personalize nga ad. Dili\nnamo kini ma-off, mao nga girekomenda hinuon namo ang pagpalit sa upgrade nga walay ad (2 USD)\n.\n\nKung paliton nimo ang upgrade nga walay ad, dili sab makakita og mga ad ang imong mga higala sa kada higayon nga\nikaw ang mag-host! Kung napalit na nimo ang upgrade kaniadto, ablihi ang store aron makuha\nang resibo.",
