        [StringNames.LocalHelp]: "Des soucis de connexion ?\n\n● Vérifiez que tout le monde est connecté au\nmême réseau Wi-Fi\n● Vérifiez que tout le monde possède la même version (voir en haut à gauche)\n● Vérifiez que le signal Wi-Fi est suffisamment fort\n● Essayez de confier l'hébergement de la partie à un autre joueur\n● Essayez de redémarrer l'application\n● Essayez de redémarrer votre téléphone\n● Le problème persiste ? Contactez-nous sur notre Discord !",
        [StringNames.OnlineHelp]: "Comment ça marche ?\n\n● Héberger une partie génère un code qui s'affiche à côté du bouton de démarrage.\n● Fournissez ce code à vos amis pour créer un salon privé.\n● Ou sélectionnez Privé afin de rendre le salon public\npour l'option « Trouver partie ».\n● L'hôte peut bannir ou expulser des joueurs chaque fois que le chat est disponible.\n● Le problème persiste ? Contactez-nous sur notre Discord !",
        [StringNames.EmergencyCount]: "LE COÉQUIPIER {0} A\n\n\n\nRÉUNION(S) D'URGENCE RESTANTE(S)",
