        [StringNames.HowToPlayText1]: "Among Us ist ein Spiel über Teamarbeit und Verrat.\n\nSpieler sind entweder Besatzungsmitglieder oder Verräter.",
        [StringNames.HowToPlayText2]: "Spielt mit 4 bis 15 Spielern online oder via lokalem WLAN!",
        [StringNames.HowToPlayText41]: "Als Host eines Spiels hast du die Kontrolle über das Spiel.",
        [StringNames.HowToPlayText42]: "Lege zuerst fest, mit wem du spielen möchtest!\n\nWenn du online mit Freunden spielen möchtest, dann stelle \"Privat\" ein und teile den Raum-Code.\n\nMöchtest du mit anderen aus der ganzen Welt spielen, dann stelle \"Öffentlich\" ein.",
        [StringNames.HowToPlayText43]: "Möchtest du mit mehr Aufgaben spielen? Wie wäre es mit höherem Tempo beim Gehen? Mehr Verräter? Als Host kannst du das einstellen. Stimme die Änderungen aber mit deinen Mitspielern ab.",
        [StringNames.HowToPlayText44]: "Sind Spieler unhöflich oder spammen, kann der Host sie als Warnung vorübergehend rauswerfen. Er kann Spieler auch für den jeweiligen Raum sperren.",
        [StringNames.HowToPlayTextMap]: "Die Spieler können eine persönliche Karte nutzen, um sich durchs Schiff zu bewegen.",
        [StringNames.HowToPlayTextCrew1]: "Ziel: Gruppen-Aufgabenleiste füllen oder Verräter enttarnen.",
        [StringNames.HowToPlayTextCrew2]: "Aufgaben erledigen, um Leiste zu füllen.",
        [StringNames.HowToPlayTextCrew3]: "Auf Sabotage des Verräters reagieren.",
        [StringNames.HowToPlayTextCrew4]: "Verräter gefunden? Notfall-Treffen!",
        [StringNames.HowToPlayTextCrew5]: "Leichen melden.",
        [StringNames.HowToPlayTextCrew6]: "Auf den Karten Admin und Security auf Verdächtiges achten.",
        [StringNames.HowToPlayTextImp1]: "Ziel: Besatzung ausschalten.",
        [StringNames.HowToPlayTextImp2]: "Unter die Besatzung mischen.",
        [StringNames.HowToPlayTextImp3]: "Durch Schächte kriechen.",
        [StringNames.HowToPlayTextImp4]: "Scheinbar Aufgaben erledigen.",
        [StringNames.HowToPlayTextImp5]: "Schiff sabotieren, Besatzung verwirren.",
        [StringNames.HowToPlayTextImp6]: "Opfer hinter Türen einsperren.",
        [StringNames.HowToPlayTextImp7]: "Besatzung zwischen Wartezeiten umbringen.",
        [StringNames.HowToPlayText5]: "Beim gemeinsamen Spielen in einem Raum herrscht Schweigepflicht, damit das Spiel für Besatzung und Verräter fair bleibt.\n\nWird ein Spieler vom Verräter getötet, darf der bis zum Spielende nicht reden.\n\nGeister können immer noch die zugewiesenen Aufgaben erledigen, um einen möglichen Sieg der Besatzung zu unterstützen.",
        [StringNames.HowToPlayText6]: "Meldet jemand eine Leiche oder beruft ein Notfall-Treffen ein, versammelt sich die Besatzung, um alles zu besprechen, was über den Verräter bekannt ist.\n\nDie Spieler können dann offen sagen, wen sie für den Verräter halten und welche Infos sie haben. Spielt ihr gemeinsam in einem Raum, dürfen Geister nicht reden, weil sie bereits wissen, wer der Verräter ist.\n\nVerräter müssen ihre Unschuld beweisen oder andere Besatzungsmitglieder beschuldigen.",
        [StringNames.HowToPlayText7]: "Nach der Besprechung stimmt ihr ab, wen ihr für den Verräter haltet.\n\nDer Spieler mit den meisten Stimmen wird aus dem Schiff geworfen. Also nie leichtfertig abstimmen!\n\nLiegen nicht genug Infos vor, könnt ihr als Besatzung beschließen, die Abstimmung zu überspringen, damit kein Unschuldiger rausgeworfen wird und ihr noch mehr Infos sammeln könnt.",
        [StringNames.HowToPlayText81]: "Übe im Modus \"Freies Spiel\"!",
        [StringNames.HowToPlayText82]: "Lege Aufgaben als Besatzungsmitglied selbst fest oder trainiere Mordstrategien als Verräter!",
