        [StringNames.LocalHelp]: "Verbindungsprobleme?\n\n● Alle müssen mit demselben WLAN-Namen\nverbunden sein.\n● Alle müssen dieselbe Version nutzen\n(oben links).\n● Das WLAN-Signal muss stark genug sein.\n● Es hilft, wenn ein anderer Spieler hostet. \n● Es hilft, die App neu zu starten ...\n● Es hilft, das Smartphone neu zu starten ...\n● Weitere Probleme? Teile es uns auf Discord mit!",
        [StringNames.OnlineHelp]: "Wie funktioniert das?\n\n● Hostest du ein Spiel, siehst du neben dem Start-Button einen Spiel-Code.\n● Teile den Spiel-Code mit Freunden, um einen privaten Raum zu erstellen.\n● Oder tippe \"Privat\" an, um den Raum für die \"Spielsuche\" öffentlich zu machen.\n● Der Host kann Spieler sperren oder rauswerfen,\n wenn ein Chat verfügbar ist.\n● Weitere Probleme? Teile es uns auf Discord mit!",
