        [StringNames.AdPolicyText]: "Dürfen wir deine persönlichen Daten verwenden, um Werbeanzeigen auf dich zuzuschneiden? Wenn du auf Ja klickst, sammeln unsere Werbepartner wie Google AdMob und Unity Ads automatisch Daten und nutzen Geräte-IDs und Cookies für personalisierte Anzeigen. Wenn du auf Nein klickst, bekommst du weiterhin nicht personalisierte Anzeigen zu sehen. Um alle Anzeigen loszuwerden, empfehlen wir den Kauf des werbefreien Upgrades [httpstore]hier[], dann sehen auch deine Freunde keine Anzeigen, wenn du hostest! Um mehr über den Datenschutz bei uns und unseren Werbepartnern zu erfahren, lies bitte unsere [https://innersloth.com/privacy.php]Datenschutzrichtlinie[]. Du kannst deine Entscheidung jederzeit im Menü Einstellungen unter „Daten“ ändern.",
