        [StringNames.LinkAccountExplanation]: "Wenn du schon ein Among-Us-Konto auf einer anderen Plattform hast, kannst du es möglicherweise verknüpfen!\nOder du kannst ein völlig neues Konto anlegen.",
        [StringNames.LinkAccountCode]: "Gib den folgenden Code bei <link=\"{0}\">{1}</link> \n<size=+2>{2}</size> ein.",
