        [StringNames.UnlinkAccount]: "Kontoverknüpfung aufheben",
        [StringNames.ConfirmUnlinkAccount]: "Aufhebung der Kontoverknüpfung bestätigen",
        [StringNames.UnlinkAccountExplain]: "Wenn du die Verknüpfung mit deinem {0}-Konto aufhebst, werden deine Daten gelöscht und ein neues {0}-Konto wird angelegt.\n– Du verlierst alle Gegenstände, die du auf deinem {0}-Konto erhalten oder freigeschaltet hast.\n- Du startest neu auf Level 1 mit 0 EP.",
        [StringNames.UnlinkAccountExplainConfirm]: "Bitte speichere diese ID:\n\n{0}\n\nWenn du die Verknüpfung mit deinem Konto aufhebst und diese ID nicht hast, können wir deinen Fortschritt nicht wiederherstellen und dir nicht weiterhelfen, falls ein Irrtum vorliegt.",
