        [StringNames.ScientistBlurbMed]: "Greife jederzeit auf die Lebensanzeige zu.\nSchließe Aufgaben ab, um deine Batterie aufzuladen.",
        [StringNames.ScientistBlurbLong]: "Der Wissenschaftler kann von überall auf eine tragbare Lebensanzeige zugreifen, um den Status der Besatzung einzusehen. Die Batterie der Anzeige muss allerdings aufgeladen werden, indem der Wissenschaftler Aufgaben abschließt.",
        [StringNames.EngineerBlurbMed]: "Kann die Schächte nutzen",
        [StringNames.EngineerBlurbLong]: "Der Ingenieur ist ein Besatzungsmitglied, das Schächte benutzen kann, um sich schneller fortzubewegen und Verräter im Schacht auf frischer Tat zu ertappen. Du kannst aber nicht lange dort drinbleiben, also sei vorsichtig ...",
        [StringNames.GuardianAngelBlurbMed]: "Schütze die verbleibende Besatzung mit einem Schutzschild",
        [StringNames.GuardianAngelBlurbLong]: "Der Schutzengel ist der Geist des ersten toten Besatzungsmitglieds. Er kann lebende Crewmitglieder vorübergehend mit einem Schild beschützen. Mit dem richtigen Timing kannst du Verräter davon abhalten, ihr Opfer zu töten.",
        [StringNames.ShapeshifterBlurbMed]: "Tarne dich, indem du dich in andere Besatzungsmitglieder verwandelst",
        [StringNames.ShapeshifterBlurbLong]: "Der Formwandler kann sein Aussehen verändern, um wie andere Besatzungsmitglieder auszusehen. Dadurch kann er anderen die Schuld in die Schuhe schieben und für Verwirrung sorgen. Aber pass auf – die Tarnung hält nicht lange an und hinterlässt Spuren.",
