        [StringNames.HowToPlayText1]: "Among Us è un gioco di collaborazione e tradimenti.\n\nI giocatori sono astronauti o impostori.",
        [StringNames.HowToPlayText2]: "Gioca in partite da 4 a 15 giocatori online o in locale via Wi-Fi!",
        [StringNames.HowToPlayText41]: "Quando ospiti una partita, decidi tu le regole del gioco.",
        [StringNames.HowToPlayText42]: "Prima, scegli con chi vuoi giocare!\n\nSe vuoi giocare con i tuoi amici online, imposta su \"privata\" e condividi il codice della stanza.\n\nSe vuoi giocare con altri giocatori da tutto il mondo, imposta su \"pubblica\".",
        [StringNames.HowToPlayText43]: "Vuoi giocare con più incarichi, camminare più rapidamente o vuoi più impostori? Se sei l'host, puoi cambiare queste impostazioni. Consultati con gli altri giocatori riguardo alle tue modifiche.",
        [StringNames.HowToPlayText44]: "Se qualcuno è sgarbato o spamma, l'host può espellere temporaneamente un giocatore come avvertimento o bannarlo dalla stanza.",
        [StringNames.HowToPlayTextMap]: "I giocatori hanno accesso a una mappa personale per orientarsi.",
        [StringNames.HowToPlayTextCrew1]: "Obiettivo: riempi la barra degli incarichi o identifica l'impostore.",
        [StringNames.HowToPlayTextCrew2]: "Completa gli incarichi per riempire la barra.",
        [StringNames.HowToPlayTextCrew3]: "Reagisci al sabotaggio dell'impostore.",
        [StringNames.HowToPlayTextCrew4]: "Trovato l'impostore?\nConvoca una riunione!",
        [StringNames.HowToPlayTextCrew5]: "Segnala i cadaveri.",
        [StringNames.HowToPlayTextCrew6]: "Fai attenzione ad attività sospette in Amministrazione e Sicurezza.",
        [StringNames.HowToPlayTextImp1]: "Obiettivo: uccidi l'equipaggio.",
        [StringNames.HowToPlayTextImp2]: "Mimetizzati tra l'equipaggio.",
        [StringNames.HowToPlayTextImp3]: "Muoviti attraverso i condotti.",
        [StringNames.HowToPlayTextImp4]: "Fingi di completare incarichi.",
        [StringNames.HowToPlayTextImp5]: "Sabota la nave e confondi l'equipaggio.",
        [StringNames.HowToPlayTextImp6]: "Chiudi le porte e intrappola le tue vittime.",
        [StringNames.HowToPlayTextImp7]: "Uccidi l'equipaggio quando le riunioni sono sospese.",
        [StringNames.HowToPlayText5]: "Per mantenere il gioco bilanciato quando si gioca di persona, è vietato parlare.\n\nSe un giocatore viene ucciso dall'impostore, non può parlare fino alla fine della partita.\n\nI fantasmi continuano a completare gli incarichi assegnati per far vincere l'equipaggio.",
        [StringNames.HowToPlayText6]: "Quando qualcuno segnala un cadavere o convoca una riunione d'emergenza, gli astronauti si riuniscono per discutere quello che sanno sull'impostore.\n\nI giocatori possono parlare liberamente e dire chi pensano sia un impostore. Quando si gioca di persona, i fantasmi non possono parlare, poiché sanno già chi è l'impostore.\n\nGli impostori provano a dimostrare la propria innocenza o ad accusare un altro astronauta.",
        [StringNames.HowToPlayText7]: "Dopo la discussione, vota chi pensi che sia un impostore.\n\nChi riceve la maggioranza dei voti viene espulso dalla nave, perciò vota con attenzione!\n\nSe non ci sono abbastanza informazioni e l'equipaggio è d'accordo, si può anche saltare il voto per evitare di espellere un innocente e ottenere altre informazioni.",
        [StringNames.HowToPlayText81]: "Fai pratica nella modalità Gioco libero!",
        [StringNames.HowToPlayText82]: "Scegli i tuoi incarichi come astronauta o allenati a uccidere come impostore.",
