        [StringNames.LocalHelp]: "Problemi di connessione?\n\n● Assicurati che tutti siano collegati alla stessa rete Wi-Fi\n● Assicurati che tutti abbiano la stessa versione del gioco (visibile in alto a sinistra)\n● Assicurati che il segnale Wi-Fi sia forte\n● A volte può essere utile che qualcun altro faccia da host\n● A volte può essere utile riavviare l'app...\n● A volte può essere utile riavviare lo smartphone...\n● Hai ancora problemi? Contattaci sul nostro server Discord!",
        [StringNames.OnlineHelp]: "Come funziona?\n\n● Ospitare una partita fornisce un codice vicino al\npulsante Inizia.\n● Condividi il codice con i tuoi amici per creare una stanza privata.\n● Oppure tocca \"Privata\" per rendere la stanza pubblica e visibile a chi cerca una partita.\n● L'host può bannare o espellere i giocatori quando la\nchat è disponibile.\n● Hai ancora problemi? Contattaci sul nostro server Discord!",
