        [StringNames.AdPolicyTitle]: "Politica sugli annunci pubblicitari",
        [StringNames.AdPolicyText]: "Possiamo utilizzare i tuoi dati personali per personalizzare gli annunci pubblicitari per te? Selezionando sì, i nostri partner pubblicitari come Google AdMob e Unity Ads raccoglieranno dati e utilizzeranno cookie e identificatori di dispositivo per la personalizzazione degli annunci. Selezionando no, potresti vedere annunci non personalizzati. Per non vedere nessuno annuncio, acquista [httpstore]qui[] l'aggiornamento per rimuovere gli annunci. In questo modo, quando fai da host, tu e i tuoi amici non vedrete nessun annuncio! Per saperne di più sulle nostre pratiche relative alla privacy e su quelle dei nostri partner pubblicitari, consulta la nostra [https://innersloth.com/privacy.php]informativa sulla privacy[]. Puoi modificare la tua scelta in qualsiasi momento nel menu impostazioni, alla voce Dati.",
