        [StringNames.ScientistBlurbMed]: "Accedi ai segni vitali quando vuoi.\nCompleta incarichi per ricaricare le batterie.",
        [StringNames.ScientistBlurbLong]: "Lo Scienziato può accedere ai segni vitali quando vuole, per controllare lo stato dell'equipaggio. Tuttavia, il pannello portatile va caricato, perciò lo Scienziato deve completare incarichi per ricaricare le batterie.",
        [StringNames.EngineerBlurbMed]: "Puoi usare i condotti",
        [StringNames.EngineerBlurbLong]: "L'Ingegnere è un astronauta che può utilizzare i condotti per muoversi rapidamente e scoprire gli impostori che li stanno usando. Tuttavia, non può stare sempre nei condotti, perciò è necessario fare attenzione...",
        [StringNames.GuardianAngelBlurbMed]: "Crea uno scudo per proteggere l'equipaggio sopravvissuto",
        [StringNames.GuardianAngelBlurbLong]: "L'Angelo custode è il fantasma del primo astronauta morto. Può proteggere temporaneamente gli altri astronauti ancora vivi. Col giusto tempismo, può impedire a un impostore di uccidere la sua vittima!",
        [StringNames.ShapeshifterBlurbMed]: "Camuffati assumendo l'aspetto di altri astronauti",
        [StringNames.ShapeshifterBlurbLong]: "Il Mutaforma può assumere l'aspetto di altri astronauti. Sfruttando quest'abilità, è possibile incastrare altri astronauti e nascondere la vera identità dell'impostore. Tuttavia, la trasformazione ha durata limitata e lascia delle tracce.",
