        [StringNames.LocalHelp]: "接続に問題がある場合\n\n●全員が同じ名称のWi-Fiに接続しているか確認してください\n\n●全員が同じバージョンでプレイしているか画面左上で確認して\n\nください\n\n●Wi-Fiの強度が十分か確認してください\n\n●ホストが代わると解決することがあります\n\n●アプリを再起動すると解決することがあります\n\n●スマートフォンを再起動すると解決することがあります\n\n●問題が解決しない場合は、Discordでお知らせください！",
        [StringNames.OnlineHelp]: "利用方法\n\n●ゲームをホストすると、スタートボタンの近くにゲームコードが表示\nされます。\n●ゲームコードを友達に共有して、プライベートルームを作成します。\n●または、「非公開」をタップしてルームを公開にし、「ゲームを探す」で見つかるようにします。\n●チャットが利用可能な場合、ホストはプレイヤーをバンしたり追放し\nたりできます。\n●問題が解決しない場合は、Discordでお知らせください！",
