        [StringNames.AdPolicyTitle]: "広告に関するポリシー",
        [StringNames.AdPolicyText]: "「Among Us」を無料でプレイしていただくため、マッチ後にはAdMobの広告が表示されます。\nAdMobはデフォルトでデータを収集し、パーソナライズド広告を表示します。ただし、非パーソナライズド広告についても、AdMobはクッキー、\n端末ID、大まかなジオデータを使用します。当社では\nこれをオフにできませんので、広告非表示のアップグレード（2ドル）の購入を\nお勧めします。\n\n広告非表示のアップグレードを購入すると、あなたがホストするゲームをプレイするお友達にも、広告が表示されません！\n以前にアップグレードをご購入された方は、ストアを開いて受け取りを\n回復してください。",
