        [StringNames.HowToPlayText1]: "Among Us es un juego de trabajo en equipo y traición.\n\nLos jugadores pueden ser tripulantes o impostores.",
        [StringNames.HowToPlayText2]: "Entre 4 y 15 jugadores en línea o en modo local mediante Wi-Fi.",
        [StringNames.HowToPlayText41]: "Si eres anfitrión de una partida, podrás elegir los ajustes del juego.",
        [StringNames.HowToPlayText42]: "Primero elige con quién quieres jugar.\n\nSi quieres jugar con tus amigos, elige «Privada» y comparte el código de la sala.\n\nSi quieres jugar con jugadores de todo el mundo, elige «Pública».",
        [StringNames.HowToPlayText43]: "¿Quieres jugar con más tareas? ¿Con más impostores? ¿Que los personajes se muevan más rápido? Como anfitrión, podrás cambiar estos ajustes. Asegúrate de que los demás jugadores estén de acuerdo.",
        [StringNames.HowToPlayText44]: "Si un jugador tiene una actitud irrespetuosa o escribe sin parar, el anfitrión puede expulsarlo temporalmente como advertencia o bloquearle el acceso a la sala.",
        [StringNames.HowToPlayTextMap]: "Los jugadores tienen acceso a un mapa personal que les ayuda a orientarse en la nave.",
        [StringNames.HowToPlayTextCrew1]: "Objetivo: Llena la barra de tareas del grupo o descubre a los impostores.",
        [StringNames.HowToPlayTextCrew2]: "Completa tareas para llenar la barra.",
        [StringNames.HowToPlayTextCrew3]: "Reacciona al sabotaje del impostor.",
        [StringNames.HowToPlayTextCrew4]: "Reúne a todos si aparece el impostor.",
        [StringNames.HowToPlayTextCrew5]: "Informa si encuentras cadáveres.",
        [StringNames.HowToPlayTextCrew6]: "Investiga a sospechosos con los mapas de administración y seguridad.",
        [StringNames.HowToPlayTextImp1]: "Objetivo: Mata a la tripulación.",
        [StringNames.HowToPlayTextImp2]: "Camúflate entre la tripulación.",
        [StringNames.HowToPlayTextImp3]: "Viaja por los conductos.",
        [StringNames.HowToPlayTextImp4]: "Finge hacer tareas.",
        [StringNames.HowToPlayTextImp5]: "Sabotea la nave y confunde a la tripulación.",
        [StringNames.HowToPlayTextImp6]: "Cierra puertas y atrapa a tus víctimas.",
        [StringNames.HowToPlayTextImp7]: "Mata a la tripulación tras el tiempo de espera.",
        [StringNames.HowToPlayText5]: "Durante el juego, los jugadores no pueden hablar entre ellos para que todo sea lo más justo posible entre la tripulación y los impostores.\n\nSi un impostor mata a un jugador, este no podrá hablar hasta el final de la partida.\n\nLos fantasmas pueden seguir haciendo tareas para contribuir a la victoria de la tripulación.",
        [StringNames.HowToPlayText6]: "Cuando alguien informa de un cadáver o convoca una reunión urgente, la tripulación se reunirá para discutir lo que sabe sobre los impostores.\n\nAhora los jugadores pueden hablar libremente sobre quién creen que es impostor y qué información tienen. Mientras están jugando, los fantasmas no pueden hablar, pues ya saben quién es impostor.\n\nLos impostores defenderán su inocencia o acusarán a otro tripulante.",
        [StringNames.HowToPlayText7]: "Tras la reunión, vota a quien creas que es impostor.\n\nQuien reciba más votos será expulsado de la nave, así que piensa bien.\n\nSi no tenéis información suficiente y llegáis a un acuerdo, podéis absteneros de votar para no expulsar a alguien inocente y seguir recabando información.",
        [StringNames.HowToPlayText81]: "¡Practica en el modo libre!",
        [StringNames.HowToPlayText82]: "Decide tus propias tareas como tripulante o practica tus dotes asesinas como impostor.",
