        [StringNames.LocalHelp]: "¿Problemas de conexión?\n\n● Todos debéis conectaros a la misma red Wi-Fi.\n● Todos debéis tener la misma versión (esquina superior izquierda).\n● Asegúrate de que la señal de red es potente.\n● A veces ayuda que otra persona sea anfitrión.\n● A veces ayuda reiniciar la aplicación o el teléfono.\n● ¿Aún tienes problemas? ¡Cuéntanoslo en nuestro Discord!",
        [StringNames.OnlineHelp]: "¿Cómo funciona?\n\n● Si eres anfitrión de una partida, aparecerá un código junto al botón «Empezar».\n● Comparte ese código con tus amigos para que se unan a tu sala privada.\n● O toca «Privada» para que cualquiera pueda encontrar la sala usando «Buscar partida».\n● El anfitrión puede bloquear o expulsar a jugadores cuando el chat está disponible.\n ¿Sigues teniendo dudas? ¡Cuéntanoslo en nuestro Discord!",
