        [StringNames.AdPolicyTitle]: "Política de publicidad",
        [StringNames.AdPolicyText]: "¿Podemos usar tus datos personales para personalizar los anuncios que te mostramos? Si aceptas, nuestros socios anunciantes, como Google AdMob y Unity Ads, recopilarán automáticamente datos, cookies e identificadores de uso del dispositivo para mostrarte anuncios personalizados. Si no aceptas, te seguiremos mostrando anuncios no personalizados. Para eliminar todos los anuncios, compra la versión sin publicidad [httpstore]aquí[]. ¡Ni tú ni tus amigos veréis anuncios cuando seas anfitrión! Consulta nuestra [https://innersloth.com/privacy.php]política de privacidad[] para saber más sobre nuestras prácticas de privacidad y las de nuestros socios anunciantes. Puedes cambiar tu decisión en cualquier momento en la sección «Datos» del menú de ajustes.",
