        [StringNames.HowToPlayText1]: "《Among Us》是一个关于团队合作与背叛的游戏。\n\n玩家分别会扮演船员和伪装者。",
        [StringNames.HowToPlayText2]: "在线或通过区域无线网与 4 至 15 名玩家一起游玩！",
        [StringNames.HowToPlayText41]: "游戏的主持人可以决定游玩的方式。",
        [StringNames.HowToPlayText42]: "首先要决定和谁一起游玩！\n\n如果您想和好友在线游玩，设置为“私人”然后分享房间代码给好友即可。\n\n如果您想和世界各地的玩家一起游玩，就设为“公开”。",
        [StringNames.HowToPlayText43]: "想要加入更多任务、加快行走速度，或添加更多伪装者？作为主持人，这些设置都可更改。不过要记得先和玩家同伴们确认这些更改。",
        [StringNames.HowToPlayText44]: "如果有人不礼貌或滥发信息，主持人可以将玩家暂时踢出以示警告，也可以封禁玩家进入特定线上房间。",
        [StringNames.HowToPlayTextMap]: "玩家拥有一张属于自己的地图，以便在船上四处移动。",
        [StringNames.HowToPlayTextCrew1]: "目标：将团队任务计量条填满或者找出伪装者。",
        [StringNames.HowToPlayTextCrew2]: "完成任务来填充计量条。",
        [StringNames.HowToPlayTextCrew3]: "处理伪装者的破坏。",
        [StringNames.HowToPlayTextCrew4]: "发现伪装者时召集紧急会议。",
        [StringNames.HowToPlayTextCrew5]: "通报所发现的尸体。",
        [StringNames.HowToPlayTextCrew6]: "查看管理室地图和保安系统来寻找可疑行动。",
        [StringNames.HowToPlayTextImp1]: "目标：杀光船员。",
        [StringNames.HowToPlayTextImp2]: "混入船员之中。",
        [StringNames.HowToPlayTextImp3]: "经由通风口隐匿行动。",
        [StringNames.HowToPlayTextImp4]: "假装进行任务。",
        [StringNames.HowToPlayTextImp5]: "破坏飞船让船员混乱。",
        [StringNames.HowToPlayTextImp6]: "关门困住受害者。",
        [StringNames.HowToPlayTextImp7]: "在冷却的空档杀光船员。",
        [StringNames.HowToPlayText5]: "为了维持船员和伪装者双方的公平性，面对面游玩时不能说话。\n\n如果有玩家被伪装者杀死，该玩家在游戏结束前都不能说话。\n\n幽灵仍需继续进行自己分配到的任务，为船员阵营争取胜利。",
        [StringNames.HowToPlayText6]: "有人报告发现尸体或召集紧急会议时，船员们将聚在一起讨论关于伪装者的已知信息。\n\n玩家这时可以开诚布公地说出自己怀疑谁是伪装者，以及自己有什么信息。在面对面游玩时，由于幽灵已经知道谁是伪装者，所以不能说话。\n\n伪装者必须试着证明自己的无辜，或是指控其他船员。",
        [StringNames.HowToPlayText7]: "讨论过后，就把票投给您认为是伪装者的人。\n\n得到最多票的人会遭到驱逐离开飞船，所以要审慎投票！\n\n如果您没有足够的信息，而且其他船员也都这么认为，则可以跳过投票来避免放逐无辜组员，然后收集更多情报。",
        [StringNames.HowToPlayText81]: "用自由模式练习一下！",
        [StringNames.HowToPlayText82]: "您可以设置作为船员的任务或扮演伪装者来演练杀戮计划！",
