        [StringNames.OnlineHelp]: "如何使用？\n\n● 主持游戏时，在开始键旁边会显示一组游戏代码。\n● 与好友分享这组游戏代码来创建私人房间。\n● 也可点击“私人”将房间公开，以在“搜索游戏”检索。\n● 可聊天时，主持人可以将玩家封禁或踢出。\n● 问题还没解决怎么办？请来我们的 Discord 告诉我们！",
