        [StringNames.LocalHelp]: "Fadhbanna ceangail?\n\n● Cinntigh go bhfuil gach duine ceangailte leis an WiFi céanna\n● Cinntigh go bhfuil an leagan ionann ag gach duine (féach ar an taobh clé thuas)\n● Cinntigh go bhfuil ceangal WiFi láidir agat\n● Scaití, cabhraíonn sé má óstálann duine eile\n● Scaití, cabhraíonn sé má atosaíonn tú an aip... \n● Scaití, cabhraíonn sé má atosaíonn tú d'fhón...\n● Fadhbanna fós agat? Cuir ar an eolas muid inár Discord!",
        [StringNames.OnlineHelp]: "Conas a oibríonn sé?\n\n● Nuair a óstaíonn tú cluiche, bíonn cód in aice leis an gcnaipe tosaithe.\n● Roinn an cód le cairde chun cluiche príobháideach a chruthú.\n● Nó cliceáil ar \"Príobháideach\" chun cluiche poiblí a chruthú.\n● Is féidir leis an óstach imreoirí a dhíbirt nó cosc a chur orthu agus an comhrá ar siúl.\n● An bhfuil fadhbanna fós agat? Má tá, inis dúinn ar Discord é!",
