        [StringNames.AdPolicyTitle]: "Polasaí Fógraíochta",
        [StringNames.AdPolicyText]: "An bhfuil cead againn do shonraí pearsanta a úsáid chun fógraí saincheaptha a chruthú duit? Má tá, baileoidh ár gcuid comhpháirtithe fógraíochta ar nós Google AdMob agus Unity Ads do shonraí go huathoibríoch agus úsáidfidh siad fianáin agus aitheantóirí gléis chun fógraí pearsantaithe a chruthú. Mura dtugann tú an cead sin dúinn, seans go bhfeicfidh tú fógraí nach bhfuil curtha in oiriúint duit. Chun fáil réidh leis na fógraí ar fad, ceannaigh an t-uasghrádú atá saor ó fhógraí [httpstore]anseo[], agus ní fheicfidh tú nó do chairde aon fhógraí agus tú i d'óstach! Chun tuilleadh a fhoghlaim faoinár gcleachtais phríobháideachta féin agus faoi chleachtais phríobháideachta ár gcuid comhpháirtithe fógraíochta, féach [https://innersloth.com/privacy.php]Polasaí Príobháideachta[]. Is féidir do chinneadh a athrú aon uair is mian leat i roghchlár na socruithe faoi \"Sonraí\".",
