        [StringNames.ScientistBlurbMed]: "Féach ar chomharthaí beatha pé uair is mian leat.\nDéan do chuid tascanna chun an cadhnra a luchtú",
        [StringNames.ScientistBlurbLong]: "Féadann an tEolaí painéil comharthaí beatha a úsáid aon áit chun stádas an chriú a sheiceáil. Mar sin féin, caithfidh an painéal a bheith luchtaithe agus mar sin beidh ar an Eolaí tascanna a chríochnú chun é sin a bhaint amach.",
        [StringNames.EngineerBlurbMed]: "Is féidir leis veinteáil (úsáid a bhaint as na gaothairí)",
        [StringNames.EngineerBlurbLong]: "Is Leathbhádóir é an tInnealtóir atá ábalta veinteáil thart go sciobtha, agus na Fealltóirí a fheiceáil agus iad ag veinteáil. Ní féidir fanacht ann i bhfad, áfach, mar sin bí aireach ar cé atá timpeall agus tú ag veinteáil…",
        [StringNames.GuardianAngelBlurbMed]: "Cuir na Leathbhádóirí faoi do choimirce",
        [StringNames.GuardianAngelBlurbLong]: "Is é an tAingeal Coimhdeachta ná an chéad Leathbhádóir a fhaigheann bás. Is féidir leis Leathbhádóirí a chosaint ó bhás go sealadach. Nach maith duit é!",
        [StringNames.ShapeshifterBlurbMed]: "Cuir bréagriocht ort féin trí chuma Leathbhádóirí eile a chur ort",
        [StringNames.ShapeshifterBlurbLong]: "Féadann an tIlchruthach a chuma a athrú trí bhréagriocht Leathbhádóirí eile a chur air féin. Sáinnigh Leathbhádóirí eile agus cothaigh anord. Fainic - ní mhaireann an bréagriocht go deo agus beidh dríodar ina dhiaidh.",
